import { LIST_TOP_UP, TOP_UP_SUCCESS, TOP_UP_FAILED, RESET_TOP_UP } from '../../config/constant'

const INITIAL_STATE = {
  fetchingListTopUp: false,
  dataTopUp: [],
  fetchingAllListTopUp: false,
  dataAllTopUp: null,
  meta: null,
  err: null
}

export default function dataReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case LIST_TOP_UP: {
      return {
        ...state,
        fetchingListTopUp: true,
      }
    }
    case TOP_UP_SUCCESS: {
      return {
        ...state,
        fetchingListTopUp: false,
        dataTopUp: action.data,
        meta: action.meta
      }
    }
    case TOP_UP_FAILED: {
      return {
        ...state,
        fetchingListTopUp: false
      }
    }
    case RESET_TOP_UP: {
      return {
        ...state,
        fetchingListTopUp: false,
        dataTopUp: []
      }
    }
    default:
      return state
  }
}
